import React from 'react';

const NotFound = (props) => {
  const navigate = useNavigate();

  return (
    <div>
      <h1>주소가 올바르지 않아요!</h1>
      <button
        onClick={() => {
          navigate("/");
        }}>뒤로가기
      </button>
    </div>
  );
};

export default NotFound;
